import React, {useState} from 'react';
import Navigation from "../Navigation/Navigation";
import "./bodytask.scss";
import Childrenbodytask from "../childrenbodytask/childrenbodytask";
import {useDispatch} from "react-redux";
import * as actions from "../../store/action";
const  Bodytask = () => {
    let dispatch = useDispatch();
    const clickShowMenu = () => {
        let action = actions.setMenu(true);
        dispatch(action);
    }
    // const [isMenu,setIsMenu] = useState(false as boolean);
    return (
        <div className="containerTask">
            <Navigation  clickShowMenu={clickShowMenu} />
            <Childrenbodytask  clickShowMenu={clickShowMenu} />
        </div>
    );
}

export default Bodytask;
